  const [expenses,setExpenses] = useState(DummyArray);

  const addItemInArray = (obj) => {
    setExpenses((initialArray) => [initialArray, ...obj])
  };

  console.log(expenses);

  return (
    <div>
      <ExpenseForm expensesAdd = {addItemInArray}/>
      <ExpenseData/>
    </div>
  );
}

export default App;
